import pandas as pd
from keras.models import load_model
import numpy as np
model = load_model('Cancer_model.h5')




def csv_to_array(filepath):
    return pd.read_csv('data1.csv').to_numpy()

def predict(gene_profile):
    gene_profile_mat = np.concatenate((gene_profile,np.zeros((len(gene_profile),9))),axis=1)
    ## add nine zeros to the end of each sample
    gene_profile_mat = np.reshape(gene_profile_mat, (-1, 71, 100))
    img_rows,img_cols = 71,100
    input_shape = (img_rows, img_cols, 1)
    gene_profile_mat = gene_profile_mat.reshape(gene_profile_mat.shape[0], img_rows, img_cols, 1)
    
    return np.ndarray.tolist(model.predict(gene_profile_mat))[0]
    



a = [round(x,5) for x in predict(csv_to_array('data2.csv'))]

